import React, { useState } from 'react';
import { DragDropContext, Droppable, Draggable } from '@hello-pangea/dnd';

const TextInput = ({ label, type, required }) => (
  <div>
    <label>{label}</label>
    <input type={type} required={required} />
  </div>
);

const FormBuilder = ({ fields, setFields, saveForm }) => {
  const [selectedField, setSelectedField] = useState(null);

  const onDragEnd = (result) => {
    const { destination, source } = result;
    if (!destination) return;

    const reorderedFields = Array.from(fields);
    const [removed] = reorderedFields.splice(source.index, 1);
    reorderedFields.splice(destination.index, 0, removed);

    setFields(reorderedFields);
  };

  const handleFieldClick = (field) => {
    setSelectedField(field);
  };

  const handleFieldChange = (e) => {
    if (selectedField) {
      const updatedField = { ...selectedField, label: e.target.value };
      setSelectedField(updatedField);

      const updatedFields = fields.map((field) =>
        field.id === selectedField.id ? updatedField : field
      );
      setFields(updatedFields);
    }
  };

  return (
    <div style={{ display: 'flex', padding: '20px' }}>
      <div style={{ width: '200px', padding: '10px' }}>
        <h2>Components</h2>
        <DragDropContext onDragEnd={onDragEnd}>
          <Droppable droppableId="sidebar">
            {(provided) => (
              <div ref={provided.innerRef} {...provided.droppableProps}>
                <Draggable draggableId="text-input" index={0}>
                  {(provided) => (
                    <div
                      ref={provided.innerRef}
                      {...provided.draggableProps}
                      {...provided.dragHandleProps}
                      style={{
                        padding: '10px',
                        marginBottom: '10px',
                        border: '1px solid #ccc',
                        borderRadius: '5px',
                        background: '#f9f9f9',
                      }}
                    >
                      Text Input
                    </div>
                  )}
                </Draggable>
                <Draggable draggableId="email-input" index={1}>
                  {(provided) => (
                    <div
                      ref={provided.innerRef}
                      {...provided.draggableProps}
                      {...provided.dragHandleProps}
                      style={{
                        padding: '10px',
                        marginBottom: '10px',
                        border: '1px solid #ccc',
                        borderRadius: '5px',
                        background: '#f9f9f9',
                      }}
                    >
                      Email Input
                    </div>
                  )}
                </Draggable>
                <Draggable draggableId="date-input" index={2}>
                  {(provided) => (
                    <div
                      ref={provided.innerRef}
                      {...provided.draggableProps}
                      {...provided.dragHandleProps}
                      style={{
                        padding: '10px',
                        marginBottom: '10px',
                        border: '1px solid #ccc',
                        borderRadius: '5px',
                        background: '#f9f9f9',
                      }}
                    >
                      Date Input
                    </div>
                  )}
                </Draggable>
              </div>
            )}
          </Droppable>
        </DragDropContext>
      </div>

      <div style={{ flex: 1, padding: '10px', border: '1px solid #ccc' }}>
        <h2>Form Builder</h2>
        <DragDropContext onDragEnd={onDragEnd}>
          <Droppable droppableId="formCanvas">
            {(provided) => (
              <div ref={provided.innerRef} {...provided.droppableProps}>
                {fields.map((field, index) => (
                  <Draggable key={field.id} draggableId={field.id} index={index}>
                    {(provided) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        style={{
                          padding: '10px',
                          marginBottom: '10px',
                          border: '1px solid #ccc',
                          borderRadius: '5px',
                          background: '#f0f0f0',
                        }}
                        onClick={() => handleFieldClick(field)}
                      >
                        {field.label}
                      </div>
                    )}
                  </Draggable>
                ))}
                {provided.placeholder}
              </div>
            )}
          </Droppable>
        </DragDropContext>

        {selectedField && (
          <div>
            <h3>Properties</h3>
            <input
              type="text"
              value={selectedField.label}
              onChange={handleFieldChange}
              placeholder="Field label"
            />
            <button onClick={saveForm}>Save Form</button>
          </div>
        )}
      </div>
    </div>
  );
};

export default FormBuilder;
